import React from 'react'
import PropTypes from 'prop-types'


const Button = ({text, color, onClick}) =>{
    return(
        <Button
            onClick = {onClick}
            style = {{backgroundColor: color}}
        >
        {text}
        </Button>
    )
}

export default Button
